import { CircularProgressbar, buildStyles } from 'react-circular-progressbar';
import 'react-circular-progressbar/dist/styles.css';



interface NavbarProps {
    avgScore: number;
    tick:number;
    cross:number;
    question:number;

}



function Sidebar ( {avgScore, tick, cross, question}:NavbarProps ) {


    //Values for Classes, Circular Progressbar



    let tickValue = 0;
    if (tick) {
        tickValue = tick;
    }
    let crossValue = 0;
    if (cross) {
        crossValue = cross;
    }

    let questionValue = 0;
    if (question) {
        questionValue = question;
    }

    let value = 0;
    if (avgScore) {
        value = avgScore;
    } 



    return (
        <>

        {/* Sidebar */}
        <div className="flex justify-center w-72 bg-white h-full">
            <div className="flex flex-col">
                <h1 className="mt-8 text-xl font-bold">Dashboard</h1>

                {/* Mini Dashboard */}
                <div className="mt-5 bg-white w-60 h-32 rounded-lg shadow-md border border-primary-2">
                    <div className="flex flex-grow justify-between ">
                        {/* Left Dashboard */}
                        <div className="flex flex-col ml-4">
                            <h1 className="mt-6 font-bold text-left">✅&nbsp;&nbsp;&nbsp;{tickValue}/22</h1>
                            <h1 className="mt-1 font-bold text-left">❌&nbsp;&nbsp;&nbsp;{crossValue}/22</h1>
                            <h1 className="mt-1 font-bold text-left">❓&nbsp;&nbsp;&nbsp;{questionValue}/22</h1>
                        </div> 
                        {/* Right Dashboard */}
                        <div className="mr-4 mt-3 ">
                            <div>
                                <h1 className="ml-3 text-sm font-bold"> Score</h1>
                            </div>
                            {/* Progressbar */}
                            <div className="mt-1" style={{ width: 70, height: 70}}>
                                <CircularProgressbar 
                                styles={buildStyles({ pathColor:'#1A56DB', textColor:'#000000' })}
                                value={value} maxValue={0.8} text={`${value}`} 
                                />
                            </div>
                        </div>
                    </div>
                </div> 
                {/* AI Results */}
                <h1 className="mt-5 text-xl font-bold">AI Results</h1>
                <div className="mt-5 bg-white w-60 h-sidebar rounded-lg shadow-md border border-primary-2"> 

                {/* HERE */}
                <Menu as="div" className="relative inline-block text-left">
                    <div>
                        <Menu.Button className="inline-flex w-full justify-center gap-x-1.5 rounded-md bg-white px-3 py-2 text-sm font-semibold text-gray-900 ring-1 shadow-xs ring-gray-300 ring-inset hover:bg-gray-50">
                        Options
                        <ChevronDownIcon aria-hidden="true" className="-mr-1 size-5 text-gray-400" />
                        </Menu.Button>
                    </div>

                    <Menu.Items
                        transition
                        className="absolute right-0 z-10 mt-2 w-56 origin-top-right rounded-md bg-white ring-1 shadow-lg ring-black/5 transition focus:outline-hidden data-closed:scale-95 data-closed:transform data-closed:opacity-0 data-enter:duration-100 data-enter:ease-out data-leave:duration-75 data-leave:ease-in"
                    >
                        <div className="py-1">
                        <Menu.Item>
                            {({ active }) => (
                                <a
                                className={`block px-4 py-2 text-sm ${active ? 'bg-gray-100 text-gray-900' : 'text-gray-700'}`}
                                >
                                Account settings
                                </a>
                            )}
                        </Menu.Item>
                        <Menu.Item>
                            {({ active }) => (
                                <a
                                className={`block px-4 py-2 text-sm ${active ? 'bg-gray-100 text-gray-900' : 'text-gray-700'}`}
                                >
                                Support
                                </a>
                            )}
                        </Menu.Item>
                        <Menu.Item>
                            {({ active }) => (
                                <a
                                className={`block px-4 py-2 text-sm ${active ? 'bg-gray-100 text-gray-900' : 'text-gray-700'}`}
                                >
                                License
                                </a>
                            )}
                        </Menu.Item>
                        <form action="#" method="POST">
                            <Menu.Item>
                            {({ active }) => (
                                <button
                                type="submit"
                                className={`block w-full px-4 py-2 text-left text-sm ${active ? 'bg-gray-100 text-gray-900' : 'text-gray-700'}`}
                                >
                                Sign out
                                </button>
                            )}
                            </Menu.Item>
                        </form>
                        </div>
                    </Menu.Items>
                </Menu>









                {/*
                </div>
                <div className="ml-4 mt-3 font-medium">
                <h1>Scope of Work:</h1>
                <h1 className="mt-9">Software Features and Functionality:</h1>
                <h1 className="mt-9">Payment Terms:</h1>
                <h1 className="mt-9">Data Security:</h1>
                <h1 className="mt-9">Service Level Agreements (SLAs):</h1>
                <h1 className="mt-9">Ownership and Intellectual Property Rights:</h1>
                <h1 className="mt-9">Contract Duration and Renewal Terms:</h1>
                <h1 className="mt-9">Exit Strategy:</h1>
                <h1 className="mt-9">Legal Review:</h1>
                */}


                </div>
            </div>
        </div>

        </>
        )
    }

export default Sidebar;
